function Log_in() {
  return (
    <form className="login">
      <input
        className="input"
        type="text"
        email="email"
        placeholder="Email..."
      />
      <input
        className="input"
        type="te"
        password="password"
        placeholder="Password..."
      />
      <input type='submit' value='Login' />
    </form>
  );
}

export default Log_in;
